        public static Texture2D GetTexture(string name)
        {
            if (!textures.ContainsKey(name)) return null;
            return textures[name].GetTexture();
        }

        public static void ReadTexture(string inPath, string outPath)
        {
            byte[] rawData = File.ReadAllBytes(inPath);

            string outString = string.Empty;

            foreach (byte b in rawData)
            {
                outString += b.ToString() + ", ";
            }

            File.WriteAllText(outPath, outString);
        }
    }
